import React from 'react'

import Data from './Data';
import Home from './Home';

const Welcome = () =>{
    
    return(
        <>
           <Home
            title={Data[0].title}
            subtitle={Data[0].subtitle}
            imgsrc={Data[0].imgsrc}
           />
           
        </>
    )
}
export default Welcome;
